kaovoi, tâysmaitojauhe, kaakaomassa, rasvaton maitojauhe, luontaiset aromi vanilja. Maitosuklaa: kaakaon kuiva-aineet vâh. 32%. Saattaa sisâltââ pâhkinât, gluteeni, soija, kananmunat.@SKLADNlKl: Cukier, tlusza kakaowy, petne mleko w proszku, miazga kakaowa, odttuszaone mleko w proszku, naturalny aromat wanilii. Czekolada mleana: masa kakaowa minimum 32%, sucha masa mleana minimum 26%. Produktmoiezawieraé.orzechy, gluten, sojeijaja.', 'https://static.openfoodfacts.org/images/products/541/295/621/4014/front_en.16.400.jpg', '35', '21', '52', '51', '', '8.5', '0.290000000000001', '0.114173228346457', '', '0');

